function add(a, b) {
  return (add = a + b);
}
function sub(a, b) {
  return (sub = a - b);
}
function mult(a, b) {
  return (mult = a * b);
}
function division(a, b) {
  return (div = a / b);
}

export { add, sub, mult, division };
